import React from "react"

function Chatbot (props) {
  return (
    <div>
      <header>
        Chatbot
      </header>
      <div>
        <Chats />
        <Channels channels={props.data}/>
      </div>
    </div>
  )
}

const Channels = props => (
  <div>
    {props.channels[0].title}
  </div>
)

const ChannelHeader = props => (
  <header>
    Channelheader
  </header>
)

function ChannelList () {
  return (
    <div>
      Channellist
    </div>
  )
}

const Channel = () => (
  <div>
    Channel
  </div>
)

function Chats () {
  return (
    <div>
      <header>
        Chats
      </header>
    </div>
  )
}

export default Chatbot
